import { X_axic, Y_axic, CellColor, CellType } from "./cellPropeties";

export class BoardCell{
    readonly Color: CellColor;
    readonly ColorUnit: CellColor;

    Type: CellType;
    X: X_axic;
    Y: Y_axic;

    constructor(color: CellColor, colorUnit: CellColor,  type: CellType, x: X_axic, y: Y_axic){
        this.Color = color;
        this.ColorUnit = colorUnit;
        this.Type = type;
        this.X = x;
        this.Y = y;
    }


}
